import React from 'react';
import NavBar from './NavBar';
import Footer from './Footer';
import FirstSection from './Home/FirstSection';
import Adoptables from './Home/Adoptables';
import Myth from './Home/Myth';

function Home(){
  return (
    <div>
    <NavBar/>
    <FirstSection/>
    <Adoptables/>
    <Myth/>
    <Footer/>
    </div>
  )
}

export default Home;
